```json
{
  "application": "Selavy",
  "software": "Selavy",
  "resource_requirements": {
    "environment_file": {
      "optional": true,
      "description": "File (.sh) with list of environment variables to be loaded by each processing node"
    },
    "mpi": {
      "optional": true,
      "default": "enabled",
      "description": "MPI run can be disabled with `--no-mpi` option"
    },
    "mpioptions": {
      "optional": true,
      "description": "Options to be passed to MPI (e.g. `--bind-to {none,hwthread, core, l1cache, l2cache, l3cache, socket, numa, board}`) (default=)"
    },
    "nproc": {
      "optional": true,
      "default": "1",
      "description": "Number of MPI processors per node used (NB: mpi tot nproc=nproc x nnodes)"
    },
    "hostfile": {
      "optional": true,
      "description": "Ascii file with list of hosts used by MPI"
    },
    "container": {
      "optional": true,
      "description": "Run inside Caesar container"
    },
    "container_image": {
      "optional": true,
      "description": "Singularity container image file (.simg) with CAESAR installed software"
    },
    "container_options": {
      "optional": true,
      "default": "none",
      "description": "Options to be passed to container run (e.g. `-B /home/user:/home/user`)"
    },
    "batch_system": {
      "optional": true,
      "default": "PBS",
      "description": "Name of batch system. Valid choices are {PBS,SLURM}"
    },
    "batch_queue": {
      "optional": true,
      "description": "Name of queue in batch system"
    },
    "job_walltime": {
      "optional": true,
      "default": "96:00:00",
      "description": "Job wall time in batch system"
    },
    "job_cpus": {
      "optional": true,
      "default": "1",
      "description": "Number of cpu per node requested for the job"
    },
    "job_nodes": {
      "optional": true,
      "default": "1",
      "description": "Number of nodes requested for the job"
    },
    "job_memory": {
      "optional": true,
      "default": "4",
      "description": "Memory in GB required for the job"
    },
    "job_user_group": {
      "optional": true,
      "description": "Name of job user group batch system"
    }
  }
}
```
